import React from "react";
import {Box} from "@mui/material";
import {BrowserRouter as Router, Link} from "react-router-dom";

function App() {
  return (
    <Box p={4}>
      <Router>
        <ul>
          <li>
            <Link to="/">Nation</Link>
          </li>
          <li>
            <Link to="/states">States</Link>
          </li>
        </ul>
      </Router>
    </Box>
  );
}

export default App;
